import React from 'react';
import PropTypes from 'prop-types';

import { Button, Panel, PanelHeader, PanelHeaderBack } from '@vkontakte/vkui';

import persik from '../img/persik.png';
import './Persik.css';

const Inventory = () => {
	const [userAccount, setUserAccount] = userAccount(null)

	return(
		<Panel>
			<PanelHeader>
				Inventory
			</PanelHeader>
			{userAccount ? (<span>1111</span>) : (<><h2>Подключите свой кошелек к приложению!</h2>
			<Button>Подключить кошелек MetaMask</Button></>)}
		</Panel>
	)
}
Inventory.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
};

export default Inventory;
